export function groupByRegNo(students) {
    return students.reduce((acc, student) => {
        if (!acc[student.Reg_No]) {
            acc[student.Reg_No] = {
                Name: student.Name,
                Reg_No: student.Reg_No,
                Year: student.Year,
                School: student.School,
                Type: student.Type,
                Applications: [] // Initially an empty array to store applications
            };
        }

        // Push application data to the Applications array
        acc[student.Reg_No].Applications.push({
            Company: student.Company,
            ApplicationStatus: student.ApplicationStatus,
            CTC: student.CTC
        });

        return acc;
    }, {});
}
